window.bookSummaryJSON = "<p>Victor the assassin is living a solitary, peaceful life in Iceland when he's drawn into a job for an unidentified Swiss broker. Having passed the test, he's introduced to a group of mercenaries and killers who are tasked to perform the ultimate assassination.In this group, Victor meets someone from his past, someone who recruited him to the life he now knows-someone he thought was dead. And when he wants out, it's too late-his former mentor has other plans for him... </p>"; 
